\r\n\r\nSonderpreis wie 2013 = 500,- Euro netto \r\n\r\n\r\nMediadaten: \r\nKompakt, übersichtlich, anregend: der neue „City Guide – LEBENSFREUDE.IM QUADRAT.“ \r\nMannheims interessante Adressen parallel im Internet und in der Mannheim App. \r\nProfitieren Sie vom Crossmedia Angebot im attraktiven City Guide Mannheim. Präsentieren Sie sich als eine der interessanten Adressen unserer Stadt in einem der Bereiche: \r\n\r\n• Shopping \r\n• Food & More \r\n• Culture \r\nAuch als Website unter » www.cityguide.morgenweb.de und iPhone-/Android App als Ergänzung zu den wichtigsten Veranstaltungen Mannheims, dem aktuellen Kinoprogramm und allen kulturellen Highlights. \r\nDiesen umfangreichen crossmedialen City Guide haben wir entwickelt für die Kongressbesucher und Touristen Mannheims, für Shopping-Affine und Lifestyle-Orientierte, für neue Bürger und natürlich für den Einzelhandel und die Gastronomie-Szene der Stadt.\r\nSeien Sie dabei und nutzen Sie unser attraktives Medium und Angebot! \r\nReservieren Sie gleich Ihr Wunsch-Format, ich berate Sie gerne über weitere Details. \r\nMit freundlichen Grüßen','2014-05-17','2014-05-17',500,NULL,NULL,30000,NULL,0,NULL,750,'2014-04-20 15:31:56',NULL,NULL,NULL,NULL,0,91,71,NULL),(90,59,10,NULL,'Einkaufsführer 2014 BGAK',0,0,NULL,'2014-05-01','2014-05-01',1,1,NULL,NULL,NULL,0,NULL,NULL,'2014-04-21 19:45:59',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(91,59,32,NULL,'Einkaufsführer 2014 Enchilada Würzburg',0,0,NULL,'2014-05-01','2014-05-01',1,1,NULL,NULL,NULL,0,NULL,NULL,'2014-04-21 19:47:15',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(92,59,38,NULL,'Einkaufsführer 2014 Besitos Würzburg',0,0,NULL,'2014-05-01','2014-05-01',1,1,NULL,NULL,NULL,0,NULL,NULL,'2014-04-21 19:48:24',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(93,60,20,21,'in Muenchen - Anzeigen-Angebot Muttertag',0,0,'Hallo zurück Herr Sieber,\r\n \r\nLust, dafür im „in“ zu werben ?\r\nWir würden uns freuen!\r\nVoila z.B.:\r\n \r\n·         Redaktionelle Einbindung / Promotion  in der Rubrik „