ck.\r\n\r\nSonnige Grüße aus Augsburg.\r\n\r\nMarkus','2014-06-01','2014-06-02',1,NULL,NULL,135000,NULL,0,NULL,NULL,'2014-05-08 11:56:41',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(121,71,23,NULL,'Parkhauswerbung',0,0,NULL,'2014-06-01','2016-05-31',1,NULL,NULL,NULL,NULL,0,NULL,1,'2014-05-08 13:52:28',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(122,72,22,NULL,'Anzeige Lokale Zeitung',0,1,NULL,'2014-05-17','2014-05-18',150,1,NULL,19000,NULL,0,NULL,650,'2014-05-08 13:54:34',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(123,73,123,NULL,'WM-Coupons',0,0,NULL,'2014-06-10','2014-06-11',695,1,NULL,128435,NULL,1,NULL,1400,'2014-05-11 11:30:02',NULL,NULL,NULL,NULL,0,326,230,NULL),(124,20,25,NULL,'Facebook - Cocktail Casino 12.05.2014',0,1,NULL,'2014-05-11','2014-05-12',29,NULL,NULL,NULL,NULL,0,NULL,29,'2014-05-11 11:40:03',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(125,20,21,NULL,'Facebook-Werbung für Nightlounge 07. Juni 2014',0,1,NULL,'2014-06-03','2014-06-07',120,NULL,NULL,NULL,NULL,0,NULL,NULL,'2014-05-11 12:41:35',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(126,20,31,NULL,'Facebook Werbung allgmein',0,1,'200 Euro total','2014-05-12','2014-06-30',200,NULL,NULL,NULL,NULL,0,NULL,200,'2014-05-12 19:48:32',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(127,20,19,NULL,'Facebook-Werbung Brunch 18.05.2014',0,1,NULL,'2014-05-15','2014-05-18',30,NULL,NULL,NULL,NULL,0,NULL,NULL,'2014-05-15 11:08:35',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(128,24,24,NULL,'Flyerverteilung Uni',0,1,NULL,'2014-05-22','2014-05-23',100,NULL,NULL,NULL,NULL,0,NULL,NULL,'2014-05-21 21:37:02',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(129,20,15,NULL,'Facebook Werbung allgmein',0,1,NULL,'2014-06-01','2014-07-31',1,NULL,NULL,NULL,NULL,0,NULL,NULL,'2014-05-31 22:59:39',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(130,74,21,NULL,'Gutscheinheft FHZV',0,0,NULL,'2014-10-01','2014-10-02',35,1,NULL,1500,NULL,0,NULL,35,'2014-06-04 23:07:17',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(131,75,38,NULL,'Kalender für die Erstsemester',0,1,NULL,'2014-10-01','2014-10-02',1