INSERT INTO `Complaint` VALUES (1,34,'Beschwerde','Lucas Seiler:\r\nKellnerin Sanchez versucht mehrfach zuviel abzurechnen.\r\nBetrug am Gast, Frechheit! Meidet diesen Rotzladen!',3,'2014-05-06','2014-05-20','2014-05-20',8,804,1003),(2,25,'Beschwerde','Ann-Kathrin Elbert:\r\nschlecht organisiert, lauwarmes essen und sehr lange Wartezeiten. Meiner Meinung nach nicht empfehlenswert',3,'2014-05-13','2014-05-19',NULL,8,804,1003),(3,33,'Beschwerde','Carsten Lehnert: Sehr schlechter Service. Beim Buffet muss man sich direkt beeilen sonst ist alles leer. Auffüllen fehl anzeige. Zwischen zeitig waren auch keine Teller mehr da. Schlechte Kalkulation. Nie mehr wieder für das Geld.',3,'2014-05-13','2014-05-14','2014-05-15',8,804,1003),(4,22,'restaurant-kritik.de','http://www.restaurant-kritik.de/bewertungen/366017?utm_campaign=news&utm_medium=email&utm_source=wall_mailer',4,'2014-05-19','2014-05-20',NULL,8,804,1003),(5,34,'Service-Beschwerde via Facebook','Bearbeitung beim Kunden!\r\n\r\nEs Tevi Milu\r\n24. Mai 13:01 \r\nWar gestern (Freitag, 23.03.2014) mit meiner Freundin in Stuttgart im Enchilada gegen 20-21.30 Uhr. In einer Kartoffel von ihr befand sich ein Stück Metalldraht!!!!!! (etwa 2 cm lang) Wahrscheinlich von der Friteuse, sagte die Kellnerin. \r\n\r\nSie entschuldigte sich. Ich finde das eine bodenlose Frechheit, dass es \"nur\" eine kleine Entschuldigung gab und damit war die Sache erledigt. \r\n\r\nVon einem GUTEN Restaurant hätte ich wenigstens einen Aperitiv als Entschuldigung erwartet. Man stelle sich vor, was passiert wäre, wenn sie den Draht gegessen hätte. Kundenfreundlichkeit sieht anders aus. Nie wieder!',3,'2014-05-24','2014-05-24',NULL,11,804,1003),(6,10,'Beschwerde','Thomas Geißler',3,'2014-05-20','2014-05-23','2014-05-24',8,804,1003),(7,34,'Beschwerde via Facebook','Kilian Seiler‎Enchilada Stuttgart\r\n26. Mai um 17:53 · \r\nPeinlich, dass ihr nichtmal regaiet nachdem ihr großspurig ein Gespräch anbietet. Und eure Kellnerin Sanchez wollte uns mehrfach über den Tisch ziehen!',3,'2014-05-26','2014-05-31',NULL,11,804,1003),(8,19,'Facebook-Beschwerde','San Cho\r\n23. Juni 00:26\r\nWAR HEUTE DAS LETZTE MAL BEI EUCH NIX LOS ABER 15 Minuten GEWARTET DAS ÜBERHAUPT JEMAND KOMMT DANN KOMMT TATSÄCHLICH JEMAND VORBEI    5 NACH 00 UHR WOLLTE  GETRÄNKE MIT TAPAS BESTELLEN ABER KÜCHE HAT ZU GEHABT\r\nVIEL GLÜCK FÜR DIE ZUKUNFT',3,'2014-06-23','2014-06-23',NULL,11,804,1003),(9,21,'Service-Beschwerde via Facebook','Die Bedienung war einfach nur dilettantisch und sehr langsam. Der Latte Macchiato hat scheußlich geschmeckt und sah auch noch so aus. Bei einer Nachbestellung ging dann der Bestellzettel verloren (hatte nach ca. 40.min. nachgefragt wo\'s bleibt.) . Zudem wurde mir mein Cocktail im \"versabberten\" Glas (übergelaufen/verschüttet) einfach so serviert! Echt ein NO- GO !!!! \r\nDas einzig positive was ich loswerden kann ist, dass man die Preise für die Cocktails würfelt. Die Idee ist echt lustig!',3,'2014-07-08','2014-07-12','2014-07-13',11,804,1001),(10,25,'Bewertung mit Beschwerde','Allgemein\r\nHeute mal mexikanische Küche - ein kurzer Blick in die Online-Speisekarte und dann los zum Enchilada. Ein leichtes Unbehagen bleibt, der erste Ausflug in das Land der Tortillas und Co. war in Aschaffenburg nicht so prickelnd.\r\n\r\nDas Laden befindet sich dort, wo zuvor das Pinguin/Don Pinguino seine Heimat hatte. Da es kurz nach 17 Uhr war als wir dort eintrafen, war die Platzsuche kein Problem.\r\n\r\nBedienung\r\nDie Wartezeit bis die Bedienung wieder vorbei kam, um die Bestellung aufzunehmen, zog sich dahin (Lokal war nicht voll, hatte ja erst aufgemacht). Nach geschätzten 30 Minuten kam das Essen, ich hatte ein Hamburger „El Gaucho“ inklusive Pommes für 12€ und als Vorspeise „Flautas con pollo“.\r\n\r\nDas Essen\r\nIch hatte ein Hamburger „El Gaucho“ inklusive Pommes für 12€ und als Vorspeise „Flautas con pollo“.\r\n\r\nEine kleine Abschweifung in Sachen Burger: Ich war in Frankfurt am Main schon in einigen Burgerläden (Heidi & Paul, Heroes, Die Kuh die lacht), dort bezahlt man in der Regel ca. 6-9€ für einen Burger, plus Pommes ca.  9-12€. Da erwartet man in Aschaffenburg für 12€ schon was!\r\n\r\nDie Vorspeise: Weizentortillas, gefüllt mit Hähnchen und Käse (Flautas con pollo) für 5,90€. Ich kann mich gar nicht mehr genau daran erinnern….so wenig war das was da aufgetischt wurde. Wenn ich nur 2,90€ dafür bezahlt hätte, hätte ich mich nicht veräppelt gefühlt, aber so…\r\n\r\nVielleicht wurde auch nur der „Gruß aus der Küche“ mit der Vorspeise verwechselt.\r\n\r\nDie bisherige Wartezeit und die Quantität der Vorspeise lässt Böses erahnen …\r\n\r\nAls das Hauptgericht (endlich) kam zeigte ein kurzer Fingerdruck auf das Fleisch, nur lauwarm! Das Brötchen (als Briochebrötchen angepriesen, also als weiches Hefebrötchen) war staubtrocken und zerbröselte in meinen Händen wie eine 4000 Jahre alte Mumie..... Nach 2-3 Bissen in der Mitte angekommen verändert sich die Konsistenz des Fleisches, denn hier war es noch ziemlich roh. Abgesehen „davon“ geschmacklich okay, auch die Pommes.\r\n\r\nWieder mal ein Grund zu sagen: „Danke für nichts!“\r\n\r\nDas Ambiente\r\nViel mexikanische Deko, südländische Farben, Spiegel und Bilder.\r\n\r\nSauberkeit\r\nKeine Beanstandungen im Restaurant. Obwohl grade erst geöffnet wurde, waren auf der Toilette (immer noch) die Papierhandtücher leer.',4,'2014-07-09','2014-07-14',NULL,11,801,NULL);
