INSERT INTO `Task` VALUES (1,8,95,NULL,'Biergarten-Eröffnung anlegen in Facebook und Internetseite','2014-04-20',703,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,0,0,0,NULL,NULL,NULL,NULL),(4,11,95,NULL,'Test-Einzelkonzept','2014-05-01',703,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,0,0,0,NULL,NULL,NULL,NULL),(7,11,14,NULL,'Besprechen im Termin:\r\nKinderecke XXL\r\n\r\nSommer-Sonne-Promo mit Terrassen-Eröffnung\r\nmit Sommerdrinks für 2 Euro (Thorsten wegen Freiware)\r\n- Spontan eventl. mit Facebook-Werbung\r\n\r\nWM\r\n- via Fernseher\r\n\r\nMittagstisch-Mailing\r\nnächstes Mailing Anfang Mai 2015 - mit 5 Gutscheinen und Flyer von den Pastavariationen\r\ngutes Feedback, mehr gutschein - gültig bis 30.06.2014 !!! (Lässt Jens von MA eintragen)\r\n\r\nspäter:\r\nPicknickset to rent (Decke, Snack, Flasche Sekt) (Zeit&Raum,Nürnberg)\r\n\r\nVatertag, 29. Mai 2014 - zu jedem Bier erhalten unsere Väter einen Obstler dazu\r\nMuttertag, 11. Mai 2014 - Prosecco für 1,90 Euro für Mütter\r\n\r\nCocktail-Casino\r\neventl. ab September (Bewerbung mit Campus-Tüte, und Campus-Party)\r\n\r\nNovember-Werbeaktion - nicht aber 15 Tage - 15 Euro','2014-05-06',703,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,NULL,0,0,NULL,NULL,NULL,NULL),(8,11,37,NULL,'Fotograph finden:\r\nFotos wären an folgenden Tage gewünscht:\r\n\r\nFreitag, 20. Juni 2014 = Eröffnung\r\nSamstag, 21. Juni 2014 = Fußballparty\r\nDienstag, 24. Juni 2014 = Tim Toupet\r\nFreitag, 27. Juni 2014 = Trixi und die Partylöwen\r\nSamstag, 28. Juni 2014 = Die Partyvögel','2015-05-15',702,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,0,0,0,NULL,NULL,NULL,NULL),(9,8,37,NULL,'Hallo ...\r\n\r\nbitte alle Pressetexte vorbereiten und freigaben lassen. Ich sende dir den Presseverteiler fuer Schweinfurt morgen zu.\r\n\r\nBitte posting einleiten, Veranstaltungen anlegen.\r\n\r\nDanke!\r\n\r\n\r\nMit freundlichen Grüßen\r\n \r\nMarkus Sieber\r\n \r\nbeon-communications\r\nPostfach 52 44\r\n97002 Würzburg\r\nmarkus.sieber@beon-communications.de\r\n \r\nM 0176/96244951\r\n \r\nVisit us - www.beon-communications.de\r\nLike us - www.facebook.com/beoncommunications\r\n________________________________________\r\nVon: Theresa Pröschel <proeschel@hahnzelt.de>\r\nGesendet: Montag, 28. April 2014 13:26\r\nAn: Markus Sieber | beon-communications\r\nBetreff: Infos Schweinfurt \r\n \r\nHallo Herr Sieber,\r\n \r\nanbei sende ich Ihnen vorab das Programm sowie unseren Flyer zu den WM Spielen.\r\n \r\nFotos wären an folgenden Tage gewünscht:\r\n \r\nFreitag, 20. Juni 2014 = Eröffnung\r\nSamstag, 21. Juni 2014 = Fußballparty\r\nDienstag, 24. Juni 2014 = Tim Toupet\r\nFreitag, 27. Juni 2014 = Trixi und die Partylöwen\r\nSamstag, 28. Juni 2014 = Die Partyvögel\r\n \r\nPressemeldungen wären für folgende Tage wichtig, bitte hier Redaktionsschluss der Medien beachten:\r\n \r\n- Fußballparty - generell hier alle 3 Tage in einer Pressemeldung zusammenfassen\r\n- Donnerstag, 26. Juni 2014 = Haxentag im Hahn-Zelt! Haxe, Bier und Fußball = Super Fantag!!! Was will man mehr? ;-) Die Haxe ist super knusprig und zart gebraten. Sehr reichliche Portion!\r\n- Mittwoch, 25. Juni = Unser Familiennachmittag mit Sonderpreisen und Zaubernesto. Er verteilt kostenlos wunderbare Ballontiere! Er zaubert schnell tolle Tiere und Gegenstände aus Luftballons.\r\n- Tanzparty mit Tanzschule Pelzer!\r\n \r\nKönnen wir dies so eintakten?\r\n \r\nmit herzlichen Grüßen\r\n \r\nTheresa Pröschel\r\nProjektorganisation\r\n \r\nHahn Zelte GmbH\r\nWeinmarkt 9\r\n91438 Bad Windsheim\r\n \r\nTelefon + 49  9841 4017 - 20 l Fax + 49  9841 4017 - 17\r\nWeb: www.hahnzelt.de\r\n \r\n  \r\n  Herz .  Gaudi .  Schmankerl .  Musik\r\n \r\nDer Inhalt dieser Nachricht stammt von der Hahn Zelte GmbH und ist streng vertraulich zu behandeln. Die Informationen sind für den oben genannten Empfänger bestimmt. \r\nSollten Sie nicht der beabsichtigte Empfänger sein und diese Nachricht irrtümlich erhalten haben, löschen Sie diese und auch die damit mitgeführten Dokumente unverzüglich. \r\nEine Benutzung, Vermehrung oder Verbreitung der Inhalte dieser Nachricht ist strengstens verboten.\r\n \r\nSitz der Gesellschaft: Bad Windsheim - Handelsregister Fürth HRB 8862 - Steuernummer: 203/140/40385 - Geschäftsführer: Michael Hahn','2014-06-01',703,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,NULL,0,0,NULL,NULL,NULL,NULL),(10,13,22,NULL,'WEB-Flyer Magarita of the Week\r\n\r\n05.05.2014	Pineapple-Cocos-Margarita\r\n12.05.2014	Strawberry-Chili-Margarita\r\n19.05.2014	Pear-Cinnamon-Margarita\r\n26.05.2014	Raspberry-Margarita\r\n02.06.2014	Blueberry-Vanilla-Margarita\r\n09.06.2014	Tropical-Margarita\r\n16.06.2014	Banana-Apple-Margarita\r\n23.06.2014	Deep-Blue-Sea-Margarita\r\n30.06.2014	Strawberry-Banana-Margarita\r\n07.07.2014	Melon-Margarita','2014-05-04',703,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,0,0,0,NULL,NULL,NULL,NULL),(11,11,24,NULL,'Radiospot The Big Easy Mainz\r\nFood + Cocktail - Spotkonzept machen','2014-07-20',701,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,NULL,0,0,NULL,NULL,NULL,NULL),(12,11,16,NULL,'Mama Mia-Spot muss produziert werden, 4 x Montags dann auf Rockland\r\n\r\nhttps://soundcloud.com/apostobamberg/','2014-05-01',701,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,0,0,0,NULL,NULL,NULL,NULL),(13,11,33,NULL,'Hochzeitsmesse im Haus - Konzept','2014-04-30',702,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,0,0,0,NULL,NULL,NULL,NULL),(14,13,22,NULL,'CC-Fähnchen-Check-IN 5.000 Stück,  beauftragt 10.04.14','2014-05-01',703,1,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,0,0,0,NULL,NULL,NULL,NULL),(15,13,22,NULL,'Check-IN-Plakate 10 Stück,  beauftragt 10.04.14','2014-05-01',703,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,0,0,0,NULL,NULL,NULL,NULL),(16,11,22,NULL,'Banner oben - Abmessungen, warten auf Infos von Erkan','2014-05-01',701,0,0,NULL,0,NULL,NULL,NULL,NULL,0,0,NULL,0,NULL,0,0,0,NULL,NULL,NULL,NULL),(17,11,22,NULL,'Tequila-Tischsets - warten auf Feedback von Erkan','2014-06-01',704,0,0,NULL,0,NULL,NU